import React from "react";
import { Switch, Route } from "react-router-dom";

const Routes = () => {
	return (
		<Switch>
			<Route exact path="/" />
			<Route exact path="/signup" />
			<Route exact path="/login" />
			<Route path="/user/:username" />
			<Route path="/recipe/:recipeId" />
		</Switch>
	);
};

export default Routes;
